import React from 'react';
import logo from "./Spotify.png";

const StyledButton = styled.button`
  background-color: black;
  font-size: 32px;
  color: white;
`;

function home() {
  return (
    <div className='home'>
  <StyledButton type="submit" onClick={() => alert("clicked")}>Search </StyledButton>
  </div>
  );

}




function App (){
    return (
      <div className="App">
        <h1>Albums:</h1>
      </div>
    );
}




export default App;
